def get_function_name(code):
    # Extract the function name from the code
    name = None
    try:
        tree = ast.parse(code)
        for node in ast.walk(tree):
            if isinstance(node, ast.FunctionDef):
                name = node.name
                break
    except SyntaxError:
        pass
    return name

